import { Container } from 'react-bootstrap'
import { HashRouter as Router, Route } from 'react-router-dom'
import Head from './components/Head';

import Home from './screens/Home';
import SubscriptionPlan from './screens/SubscriptionPlan';
import LoginManager from './screens/LoginManager';
import RegisterScreen from './screens/RegisterScreen';
import PaymentScreen from './screens/PaymentScreen'
import InitialOrderScreen from './screens/InitialOrderScreen';

function App() {
  return (
    <Router>
      <Head />
        <main>
          <Container className="py-3">
          <Route path='/' component={Home} exact />
          <Route path='/login' component={LoginManager} />
          <Route path='/register' component={RegisterScreen} />
          <Route path='/initialOrder' component={InitialOrderScreen} />
          <Route path='/payment' component={PaymentScreen} />
          <Route path='/subscription/:id' component={SubscriptionPlan} />
          </Container>
        </main>
    </Router>
  )
}

export default App;
